import '../CreateTodoButtom/CreateTodoButtom.css';

export default function CreateTodoButtom(props){

    const onClickButton = () =>{
        props.setOpenModal(prevState => !prevState);
    }

    return(
        <button 
        className="CreateTodoButton"
        onClick={onClickButton}
        >
            +
        </button>
    );
}
